import { BrowserRouter, Routes, Route } from "react-router-dom";
import { HomePage, ScrollerPage } from "./pages";
import BazosHlidacPage from "./pages/BazosHlidac";

function App() {
  return (
    <BrowserRouter>
      	<Routes>
			<Route path="/" element={<HomePage />} />
		</Routes>
    </BrowserRouter>
  );
}

export default App;
